catalog_script_client.script:
function onChange(control, oldValue, newValue, isLoading) {
    if (isLoading || newValue == '') {
        return;
    }
    var ga = new GlideAjax('AjaxGetKFSAcctInfo'); //Script Include name

    ga.addParam('sysparm_name', 'getAcctInfo'); //the function inside the Script Include
    ga.addParam('sysparm_acct_number', g_form.getValue('visio_365_kfs_account_number'));
    ga.getXML(updateInfo);
}



function updateInfo(response) {


    answer = JSON.parse(response.responseXML.documentElement.getAttribute("answer"));


    if (answer) {

        var returneddata = answer;

        //g_form.setValue("whcsAccessrequest_ucinetid", returneddata.var3);
        g_form.setValue('visio_365_account_name', returneddata.var1);
        //g_form.setValue('whcsAccessrequest_manager', returneddata.var2);
    } else {

        alert('eat booty');

    }

}
